$_MODULE['<{mbeshipping}prestashop>welcome_06acb34650df4917a32a707f41eb0994'] = 'Envíos y logística digitalizada con MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_bd279c91483c0fd991bf0dd24082c847'] = 'Dé un nuevo impulso a su comercio electrónico con la solucion MBE para digitalizar envíos y logística, diseñadas para empresas, emprendedores pero también artesanos que buscan un socio confiable que pueda ayudarlos a llevar su negocio en línea con éxito con soluciones completas y flexibles. ¿Eres cliente de MBE? ';
$_MODULE['<{mbeshipping}prestashop>welcome_02d4482d332e1aef3437cd61c9bcc624'] = 'Contacta con nosotros';
$_MODULE['<{mbeshipping}prestashop>welcome_ee3ae8f2b909a448403a77ffbb3cb259'] = 'Iniciar la configuración';
$_MODULE['<{mbeshipping}prestashop>welcome_0d7545e6e62aa27411c09e133edba866'] = 'Al conectar la plataforma MBE directamente a su sitio web de comercio electrónico, puede automatizar la gestión de envíos y facilitar el proceso de ventas. ';
$_MODULE['<{mbeshipping}prestashop>welcome_461b35b457d9b9ba7ee9b502c377cc30'] = 'Soluciones digitales MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_1bcd51908f4de69964082ee6a92fa697'] = 'Servicios digitales llave en mano que ayudan a que tu marca despegue. Llegue a sus clientes en línea con soluciones digitales y herramientas de marketing web que le brindan más oportunidades de llegar a su audiencia al crear una presencia en línea efectiva para su negocio y estar donde están sus clientes. MBE te ofrece soluciones efectivas para hacer crecer tus canales digitales. Muestre su marca, tienda de comercio electrónico o mejore su sitio web actual para hacerlo más visible en los motores de búsqueda.';
$_MODULE['<{mbeshipping}prestashop>welcome_47e149951cc16a06badb305ea12b2dd5'] = 'Embalaje MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_6efcae05527f34189a6799f27c0ae9bd'] = 'El servicio de empaquetado que da ventaja a su negocio. Sus clientes se merecen una experiencia única: sorpréndalos durante el unboxing con soluciones de embalaje personalizadas para sus productos. Una solución altamente personalizada que realza su marca y añade un toque de estilo basado en sus necesidades específicas. Además de optimizar el tiempo y los recursos, puede reducir su impacto medioambiental, ya que MBE utiliza técnicas y materiales de embalaje innovadores.	';
$_MODULE['<{mbeshipping}prestashop>welcome_7f59c0ca6fc8f4127ae2692ca2d363a5'] = '¡Ahora sabe que tiene un socio confiable a su lado!';
$_MODULE['<{mbeshipping}prestashop>welcome_eca6d7ebbb683e1d8ae9813c82ca5228'] = 'MBE es el socio de extremo a extremo adecuado que admite todas las realidades en la transición a lo digital al proporcionar soluciones completas y llave en mano.';
